import React, { useEffect } from "react";
import axios from 'axios';

const url = 'http://localhost:3001/practicas'; // Cambia la URL según tu configuración

const HomePage = () => {
  useEffect(() => {
    axios.get(url)
      .then(response => {
        console.log('Prácticas obtenidas correctamente:');
        console.log(response.data);
      })
      .catch(error => {
        console.error('Error al obtener las prácticas:', error.response ? error.response.data : error.message);
      });
  }, []); // Agrega un array vacío como segundo argumento para asegurar que useEffect se ejecute solo una vez al montar el componente

  return (
    <div>
      <div className="pt-44">
        <h1 className="w-1/2 h-28 bg-blue-600 rounded-xl flex items-center justify-center m-auto text-6xl font-bold text-white drop-shadow-lg">
          CoPra
        </h1>
        <form id="barraBusqueda" className="m-auto w-1/4 pt-6">
          <input
            type="text"
            id="busqueda"
            placeholder="Buscar empleo"
            className="bg-gray-100 placeholder-black p-1 border w-full rounded-xl drop-shadow-lg"
          />
        </form>
      </div>
    </div>
  );
};

export default HomePage;
